import React from 'react';
import { Header } from '../Header/header.tsx';
import { Hero } from '../Hero/hero.tsx';
import mainImg from '../../assets/Vector 641.jpg'

export default function App() {
  return (
    <div className="body-page relative">

      <div className='main shadow-2xl relative'>        
        <Header /> 
          
        <Hero /> 
        <img className='w-1/2 absolute -bottom-2 z-0' src={mainImg} />           
      </div>

      <div className='w-[500px] flex justify-between absolute right-16 top-24 -rotate-90'>
        <div className='w-24 bg-[#FF8F4B]'></div>
        <span className='text-black font-abeezee text-xs'>Todos os direitos reservados ao Acelera FJS</span>
        
      </div>

    </div>
  );
}
